import React from 'react';
import './Header.css';


const Header = () => {
    return (
    <header className='header'>
    <img src="logo192.png"></img>
    <div id="logo">
            <span className="icon">date_range</span>
            <span>
              react<b>calendar</b>
            </span>
          </div>
    </header>
    )
}

export default Header;
